function startIntro(){
    var isLandscape = this.game.height / this.game.width  < 1.3 ? true: false;
    game.add.tween(this.logo).to({alpha: 1}, 350, Phaser.Easing.Quadratic.Out,true);

    if(!isLandscape){
        this.popup(this.logo, this.game.width, window.innerHeight, 0 ,0.5)
         var tween = game.add.tween(this.introText).to({y: window.innerHeight*0.45}, 300, Phaser.Easing.Quadratic.Out).start();
        tween.onComplete.add(function(){
            this.game.time.events.add(1000, this.startTutorial)
        })
    }
    else{
        this.popup(this.logo, this.game.width, window.innerHeight, 0 ,0.6)
         var tween = game.add.tween(this.introText).to({y: window.innerHeight*0.5}, 300, Phaser.Easing.Quadratic.Out).start();
        tween.onComplete.add(function(){
            this.game.time.events.add(1000, this.startTutorial)
        })
    }
}

